As at 26th Feb 2020, 11 suspect cases of #COVID19 have been tested in Nigeria &amp; all turned negative

We urge the public to disregard &amp; discourage the spread of rumours

@NCDCgov continues to monitor the outbreak globally &amp; will inform the public if a case is reported in #Nigeria https://t.co/S0Mp36nDzy

@DrTedros "What we see are epidemics in different parts of the world, affecting countries in different ways &amp; requiring a tailored response.

The sudden increase in new #COVID19 cases is certainly very concerning. 

I have spoken consistently about the need for facts, not fear"-@DrTedros

